import reactDom from 'react-dom';
import BGimg from './assets/attract.jpg';


export default function Background() {

        return ( 
            <div style={{  
                backgroundImage: "url($(BGimg))",
                backgroundPosition: 'center',
                backgroundSize: 'cover',
                backgroundRepeat: 'no-repeat'
              }} >        
                hello
            </div>
         );
    
}
